pragma solidity >=0.4.21 <0.7.0;
import "./SetSick.sol";

/**
 * The MedicalRecord contract does this and that...
 */
contract Medical is SetSick {
    event Transfer(address _from, address _to, uint256 _tokenId);

    struct MedicalRecord {
        // h s bnh n
        uint256 idpatient;
        uint256 sickcode; //id patient
        uint256 readyTime;
        uint256 MedicalExaminationCount; // s bn ghi record
    }

    struct MedicalExamination {
        // luu du data patient theo lich su kham benh
        uint256 readyTime;
        string diagnostic;
    }

    mapping(uint256 => uint256) RecordMedicalExaminations; // medicalExaminations=>medicalrecords;

    MedicalRecord[] public medicalrecords;
    MedicalExamination[] public medicalExaminations;

    modifier MedicalRecordCreated(uint256 _patientId, uint256 _sickCode) {
        uint256 _count = 0;
        for (uint256 i = 0; i < medicalrecords.length; i++) {
            if (
                medicalrecords[i].idpatient == _patientId &&
                medicalrecords[i].sickcode == _sickCode
            ) {
                _count++;
            }
        }
        require(_count == 1);
        _;
    }

    function _createMedicalRecord(uint256 _patientId, uint256 _sickCode)
        public
        onlyOwnerOf(_patientId)
    {
        uint256 readyTime1 = uint256(now);
        medicalrecords.push(
            MedicalRecord({
                idpatient: _patientId,
                sickcode: _sickCode,
                readyTime: readyTime1,
                MedicalExaminationCount: 0
            })
        );
    }

    function RecordMedical(
        uint256 _patientId,
        uint256 _sickCode,
        string memory _diagnostic
    ) public onlyOwnerOf(_patientId) {
        // luu du data kham benh
        uint256 idMedicalRecord = _checkMedicalRecordInitializated(
            _patientId,
            _sickCode
        );
        uint256 readyTime = uint256(now);
        uint256 idmedicalExamination = medicalExaminations.push(
            MedicalExamination(readyTime, _diagnostic)
        ) -
            1;
        medicalrecords[idMedicalRecord].MedicalExaminationCount++;
        RecordMedicalExaminations[idmedicalExamination] = idMedicalRecord;
    }

    function _checkMedicalRecordInitializated(
        uint256 _patientId,
        uint256 _sickCode
    ) public returns (uint256) {
        //kim tra h s bnh nhn vs bnh ny  c to cha .
        for (uint256 i = 0; i < medicalrecords.length; i++) {
            if (
                medicalrecords[i].idpatient == _patientId &&
                medicalrecords[i].sickcode == _sickCode
            ) {
                return i;
            }
        }

        _createMedicalRecord(_patientId, _sickCode);
        return medicalrecords.length - 1;

    }

    function getRecordMedical(uint256 _patientId, uint256 _sickCode)
        public
        view
        MedicalRecordCreated(_patientId, _sickCode)
        returns (uint256[] memory)
    {
        uint256 _idMedicalRecord;
        for (uint256 i = 0; i < medicalrecords.length; i++) {
            if (
                medicalrecords[i].idpatient == _patientId &&
                medicalrecords[i].sickcode == _sickCode
            ) {
                _idMedicalRecord = i;
            }
        }
        uint256[] memory result = new uint256[](
            medicalrecords[_idMedicalRecord].MedicalExaminationCount
        );
        uint256 counter = 0;
        for (uint256 j = 0; j < medicalExaminations.length; j++) {
            if (RecordMedicalExaminations[j] == _idMedicalRecord) {
                result[counter] = j;
                counter++;
            }
        }
        return result;

    }
    function CreatePatient(
        string memory _name,
        string memory _cmt,
        uint256 _age,
        uint256 _sex
    ) public {
        //khai bao lai CreatePatient ke thua tu patientcontract
        uint256 patientId = patients.length;
        uint256 id = patients.push(
            Patient(patientId, _name, _cmt, _age, _sex, true)
        ) -
            1;
        PatientToOwner[id] = msg.sender;
        _setPatientSick(id, 0);
        OwnerPatientCount[msg.sender]++;
        emit NewPatient(id, _name, _cmt, _age, _sex, true);

    }

}
